import React from 'react'


const Calculator = () => {

const numbers = ['C', '1', '2', '+', '3', '4', '-', '5', '6', '*', '7', '8', '/', '=', '9', '0', '.']

  return (
  
    <div>
    <input type="text" readOnly/>
    <div>{
        numbers.map((num) => {
            return(
        <button>{num}</button>
    )
        })
    }
    </div>
    </div>
  )
}

export default Calculator
